import { useState, useEffect } from 'react';
import GetCountry from '../helpers/GetCountry';

export default function UseGetCountry() {
	const [state, setState] = useState({
		data: []
	});

	useEffect(() => {
		GetCountry().then(imgs => {
			setState({
				data: imgs
			});
		});
	}, []);

	return state;
}
